import React, { Component } from "react";

class Contact extends Component {
    render() {
        return (
            <div>
                <h1>Kontakt</h1>
                <h2>POLITECHNIKA BIAŁOSTOCKA</h2>
                <p>ul. Wiejska 45A, 15-351 Białystok</p>
                <p>tel. 85 746 90 00, fax 85 746 90 15</p>
                <p>REGO: 000001672 NIP: 542-020-87-21</p>
            </div>
        );
    }
}

export default Contact;
